// calc

const inputSum = document.querySelector('.sum-input')
const inputPeriod = document.querySelector('.period-input')
const calcTotal = document.querySelector('#calcTotal')
const calcLabel = document.querySelector('#calcLabel')


const sum = value => {
  inputSum.innerHTML = value + '$'
  if(value <= 100000) {
    calcLabel.innerHTML = 150 + '$'
  } else {
    calcLabel.innerHTML = 285 + '$'
  }
}

const period = value => {
  inputPeriod.innerHTML = value + ' месяцев'
  calcTotal.innerHTML = parseInt(calcLabel.innerHTML) * value + '$'
}


// accordion

const $accordionItem = document.querySelectorAll('.accordion-list__item')
const $arrow = document.querySelectorAll('.arrow')
const $answer = document.querySelector('.answer')
const $content = document.querySelectorAll('.content')

$content.forEach(item => {
  item.addEventListener('click', () => {
    const parent = item.parentNode
    
    if(parent.classList.contains('active')) {
      parent.classList.remove('active')
    } else {
      $accordionItem.forEach(child => child.classList.remove('active'))
      parent.classList.add('active')
    }

  })
})

